import { formRow } from 'aws-amplify'
import Theme from './Theme'

const Contact = () => {
  return (
    <div id='contact'>
      <Theme
        titleBoxStyle='contact-title-box'
        titleStyle='contact-title'
        titleValue='CONTACT ME'
      />
      <Info type='EMAIL' value='peggylau1994@gmail.com' />
      <Info type='GITHUB' value='https://github.com/Peggy-liu' />
      <Info type='LINKEDIN' value='https://www.linkedin.com/in/peiqi-peggy-liu-a788aa155' />
      <ContactForm />
    </div>
  )
}

const Info = props => {
  return (
    <div className='contact-info'>
      <h3 className='contact-header'>{props.type}</h3>
      <a className='contact-line-item' href={props.value} >{props.value} </a>
    </div>
  )
}

const ContactForm = () => {
    return (
        <div className='contact-info'>
            <h3 className='contact-header'>LEAVE ME A MESSAGE</h3>
            <form>
                <p>Your Contact</p>
                <input type='text' name='contact' placeholder='email/phone' size='80'/>
                <p>Message</p>
                <textarea rows='20' cols='80' placeholder='leave your message here, I will get back to you ASAP...'/>
                <input type='submit' />
            </form>
        </div>
    );
}

export default Contact
